import React, { useState } from 'react';
import { Link } from 'react-router-dom';

const StudentDashboard = () => {
  const [chatMessages, setChatMessages] = useState([]);
  const [newMessage, setNewMessage] = useState('');
  const [chatbotResponses, setChatbotResponses] = useState({
    'Hi': 'Hello!',
    'How are you?': 'I am just a chatbot. How can I help you today?',
    // Add more predefined questions and responses here
  });

  const handleChatInputChange = (event) => {
    setNewMessage(event.target.value);
  };

  const handleSendChatMessage = () => {
    if (newMessage) {
      // Add the user's message to the chat
      setChatMessages([...chatMessages, { message: newMessage, user: true }]);

      // Check if the message has a predefined response
      if (chatbotResponses[newMessage]) {
        const response = chatbotResponses[newMessage];
        setChatMessages([...chatMessages, { message: response, user: false }]);
      } else {
        // If there's no predefined response, you can have a default response
        setChatMessages([...chatMessages, { message: "I don't understand your question.", user: false }]);
      }

      // Clear the input field
      setNewMessage('');
    }
  };


  return (
    <div>
      <header>
        <h1>MS in DS Academic Program</h1>
      </header>
      <nav>
        <Link to="/Files">Files</Link>
        <Link to="/Grades">Grades</Link>
        <Link to="/Appointments">Appointments</Link>
        <Link to="/Messages">Messages</Link>
        <Link to="/">Logout</Link>
      </nav>
      <div className="container">
        <div className="content">
          <div className="dashboard">
            <div className="section">
              <h2>CSE 5321-001</h2>
              <Link to="/analytics">ANALYTICS</Link>&nbsp;
              <Link to="/assessment">TAKE AN ASSESSMENT</Link>&nbsp;
              <Link to="/reports">REPORTS</Link>
            </div>
            <div className="section">
              <h2>CSE 5334-004</h2>
              <Link to="/analytics">ANALYTICS</Link>&nbsp;
              <Link to="/reports">REPORTS</Link>&nbsp;
              <Link to="/assessment">TAKE AN ASSESSMENT</Link>
            </div>
            <div className="section">
              <h2>CSE 6324-003</h2>
              <Link to="/analytics">ANALYTICS</Link>&nbsp;
              <Link to="/reports">REPORTS</Link>&nbsp;
              <Link to="/assessment">TAKE AN ASSESSMENT</Link>
            </div>
          </div>
        </div>
        <div className="chat-box">
          <div className="close-button">X</div>
          <div className="chat-title">Welcome to the Chatbox!!</div>
          <div className="chat-content">
            {chatMessages.map((message, index) => (
              <div key={index} className={message.user ? 'user-message' : 'chatbot-message'}>{message.message}</div>
            ))}
          </div>
          <input
            type="text"
            className="chat-input"
            placeholder="Type here"
            value={newMessage}
            onChange={handleChatInputChange}
          />
          <button className="chat-button" onClick={handleSendChatMessage}>
            SEND
          </button>
        </div>
      </div>
      <footer>
        <p>@ copyright MS in DS Academic Program</p>
      </footer>
    </div>
  );
};

export default StudentDashboard;
